  x-logo: data:image/png;base64,
openapi: 3.0.2
paths:
  tmp0:
    post:
      description: Cybereason Block or Unblock an Item
      parameters:
      - description: IP, Domain, or Hash CSV values to blacklist or whitelist
        example: ''
        in: query
        name: Values
        required: true
        schema: {type: string}
      - description: Either 'blacklist' or 'whitelist'
        example: ''
        in: query
        name: Action
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: Cybereason Block Item
  tmp1:
    post:
      description: Cybereason get alerts from MalOps
      parameters:
      - description: Filter MalOps returned by any time greater than creation time.
          See README for relative time formats
        example: Thursday, July 30, 2020 1:08:18.571 AM
        in: query
        name: Creation Time
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp1'}
          description: Successful request
      summary: Cybereason Get MalOps Alerts
  tmp2:
    post:
      description: Cybereason isolate a host by port
      parameters:
      - description: IP to block
        example: ''
        in: query
        name: IP
        required: true
        schema: {type: string}
      - description: Port to block
        example: ''
        in: query
        name: Port
        required: true
        schema: {type: string}
      - description: Direction to block traffic, one of 'ALL', 'INCOMING', 'OUTGOING'
        example: ''
        in: query
        name: Direction to block
        required: true
        schema: {type: string}
      - description: If true will isolate, false will remove from isolation
        example: ''
        in: query
        name: Block
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp2'}
          description: Successful request
      summary: Cybereason Isolate Host
  tmp3:
    post:
      description: Check Cybereason for a domain
      parameters:
      - description: Domain to search for
        example: ''
        in: query
        name: Domain
        required: true
        schema: {type: string}
      - description: Limit of results to return
        example: ''
        in: body
        name: Limit
        required: false
        schema: {type: string}
      - description: Timeout
        example: '12000'
        in: body
        name: Timeout (ms)
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp3'}
          description: Successful request
      summary: Cybereason Query for Domain
  tmp4:
    post:
      description: Check Cybereason for a hash
      parameters:
      - description: Hash to search for
        example: ''
        in: query
        name: Hash
        required: true
        schema: {type: string}
      - description: Limit of results to return
        example: ''
        in: body
        name: Limit
        required: false
        schema: {type: string}
      - description: Timeout
        example: '12000'
        in: body
        name: Timeout (ms)
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp4'}
          description: Successful request
      summary: Cybereason Query for Hash
  tmp5:
    post:
      description: Check Cybereason for a IP
      parameters:
      - description: IP to search for
        example: ''
        in: query
        name: IP
        required: true
        schema: {type: string}
      - description: Limit of results to return
        example: ''
        in: body
        name: Limit
        required: false
        schema: {type: string}
      - description: Timeout
        example: '12000'
